import { Button, Icon } from "@mui/material";
import "./Landing.css";
const Landing = () => {
    return (
        <div className="front-page">
            <h1 className="app-name">Personal CIA</h1>
            <Button
                className="front-page-child"
                sx={{ width: 317 }}
                variant="outlined"
                color="success"
                endIcon={<Icon>arrow_forward_ios_sharp</Icon>}>
                    LOG IN
                </Button>
            <div className="sign-up">Sign up</div>
        </div>
    );
};

export default Landing;
